Comment:
- Quán có cả một không gian rộng rãi nằm trên tầng 2, không gian ấm áp, nhẹ nhàng, có mô hình cổ máy pha cà phê từ xưa khá hay ho nằm giữa quán;
- Nhân viên chuyên nghiệp, phục vụ tốt;
- Cà phê ở đây được đánh số, hãy hỏi nhân viên để lựa chọn khẩu vị phù hợp với mình. Cà phê rất thơm, ngon tuyệt, có âm nhạc.
